from collections import deque

def highestPeak(isWater):
    (m, n) = (len(isWater), len(isWater[0]))
    dirn = [(0, 1), (0, -1), (1, 0), (-1, 0)]
    q = deque()
    height = [[float('inf')] / n for _ in range(m)]
    for i in range(m):
        for j in range(n):
            if isWater[i][j] == 1:
                q.append((i, j, 0))
                height[i][j] = 0
    while q:
        (x, y, h) = q.popleft()
        for (dx, dy) in dirn:
            (nx, ny) = (x + dx, y + dy)
            if nx >= 0 and nx < m and (ny >= 0) and (ny < n) and (height[nx][ny] > h + 1):
                height[nx][ny] = h + 1
                q.append((nx, ny, h + 1))
    return height

